import React from 'react';
import { useParams } from 'react-router-dom';
import {
  Container,
  Grid,
  Typography,
  Button,
  Box,
  Paper,
  Rating,
  Divider,
  IconButton,
} from '@mui/material';
import {
  ShoppingCart as ShoppingCartIcon,
  Favorite as FavoriteIcon,
} from '@mui/icons-material';
import { useDispatch, useSelector } from 'react-redux';
import { addToCart } from '../../store/slices/cartSlice';
import { toggleFavorite, selectIsFavorite } from '../../store/slices/favoritesSlice';

const UrunDetay = () => {
  const { id } = useParams();
  const dispatch = useDispatch();
  const isFavorite = useSelector((state) => selectIsFavorite(state, id));

  const urun = useSelector((state) => selectUrunById(state, id));

  if (!urun) {
    return (
      <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
        <Typography variant="h5" color="error">
          Ürün bulunamadı.
        </Typography>
      </Container>
    );
  }

  const handleAddToCart = () => {
    dispatch(addToCart(urun));
  };

  const handleToggleFavorite = () => {
    dispatch(toggleFavorite(urun));
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Paper elevation={3} sx={{ p: 3 }}>
        <Grid container spacing={4}>
          {/* Ürün Resmi */}
          <Grid item xs={12} md={6}>
            <Box
              component="img"
              sx={{
                width: '100%',
                height: 'auto',
                borderRadius: 2,
              }}
              src={urun.resim}
              alt={urun.baslik}
            />
          </Grid>

          {/* Ürün Detayları */}
          <Grid item xs={12} md={6}>
            <Typography variant="h4" gutterBottom>
              {urun.baslik}
            </Typography>
            <Typography variant="h6" color="text.secondary" gutterBottom>
              {urun.yazar}
            </Typography>
            <Typography variant="subtitle1" color="text.secondary" gutterBottom>
              {urun.yayinevi}
            </Typography>

            <Box sx={{ my: 2 }}>
              <Rating value={urun.puan} precision={0.5} readOnly />
              <Typography variant="body2" color="text.secondary">
                ({urun.puan}/5)
              </Typography>
            </Box>

            <Typography variant="h5" color="primary" sx={{ my: 2 }}>
              {urun.fiyat.toFixed(2)} TL
            </Typography>

            <Box sx={{ display: 'flex', gap: 2, my: 3 }}>
              <Button
                variant="contained"
                startIcon={<ShoppingCartIcon />}
                onClick={handleAddToCart}
                size="large"
              >
                Sepete Ekle
              </Button>
              <IconButton
                color={isFavorite ? 'secondary' : 'default'}
                onClick={handleToggleFavorite}
                sx={{ border: 1, borderColor: 'divider' }}
              >
                <FavoriteIcon />
              </IconButton>
            </Box>

            <Divider sx={{ my: 3 }} />

            <Typography variant="h6" gutterBottom>
              Ürün Açıklaması
            </Typography>
            <Typography variant="body1" color="text.secondary">
              {urun.aciklama}
            </Typography>

            <Box sx={{ mt: 3 }}>
              <Typography variant="body2" color="text.secondary">
                Stok Durumu: {urun.stok} adet
              </Typography>
            </Box>
          </Grid>
        </Grid>
      </Paper>
    </Container>
  );
};

export default UrunDetay;
